import React, { useState, useEffect } from 'react';
import Finder from '../apis/Finder';

const CategoryList = () => {

  useEffect(async () => {
      try {
        const res = await Finder.get('/categories');
        console.log(res);
      } catch (error) {
        console.error(error);
      }
  })

  return (
    <div>
      <h2>Category List</h2>
      <ul>
        {categories.map((category, index) => (
          <li key={index}>
            <strong>{category.category_name}</strong>: {category.keywords}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CategoryList;
